          "reviewer": ids["zxiiro"],
          "message": "Patch Set 6:\n\n\u003e So something\u0027s not working right. I get the following messages when\n \u003e running which seems to show that the alternatives isn\u0027t getting\n \u003e set.\n \u003e \n \u003e [coe-sonar] $ /bin/bash /tmp/jenkins5807924860229954215.sh\n \u003e ---\u003e Updating Java version\n \u003e ---\u003e RedHat type system detected\n \u003e /usr/lib/jvm/java-1.7.0-openjdk/bin/java has not been configured as\n \u003e an alternative for java\n \u003e /usr/lib/jvm/java-1.7.0-openjdk/bin/javac has not been configured\n \u003e as an alternative for javac\n \u003e /usr/lib/jvm/java-1.7.0-openjdk has not been configured as an\n \u003e alternative for java_sdk_openjdk\n\nSeems like alternatives --set command doesn\u0027t work correctly on CentOS.\n\nhttps://serverfault.com/questions/658458/install-oracle-java-using-alternatives-system-on-centos-7\n\nThe problem though is `alternatives --config` is not a non-interactive command and requires a prompt. Not sure if there\u0027s a better way to do this. Curious how Ansible handles this because the ansible alternatives task seems to work."
