          "reviewer": ids["zxiiro"],
          "message": "while this is cool and convenient. I\u0027d be more comfortable having this as part of a single macro with the builder in a way where the credential is provided. The macro runs what it needs to and immediately removes the credential.\n\nFor example docker login macro:\nhttps://github.com/lfit/releng-global-jjb/blob/master/jjb/lf-macros.yaml#L20-L27\n\nThis is to guard against the \"env\" call at the end of the job not accidently leaking these credentials and ensures that they only exist for as long as they are needed.",
